import React from "react";
import PageNotFound from "../Pages/PageNotFound";
import Users from "../Pages/Users";
import App from "../App";
const routes = {
  "/": () => <Home />,
  "/": () => <App />,
  "/user": () => <Users />,
  "/PageNotFound": () => <PageNotFound />
};
export default routes;
